import shortid from "shortid";

export const SIDEBAR_ITEM = "sidebarItem";
export const ROW = "row";
export const COLUMN = "column";
export const COMPONENT = "component";

export const SIDEBAR_ITEMS = [{
        id: shortid.generate(),
        type: SIDEBAR_ITEM,
        component: {
            type: "ca",
            content: "contatoaberto"

        }
    },
    {
        id: shortid.generate(),
        type: SIDEBAR_ITEM,
        component: {
            type: "---| / |---",
            content: "--| / |---"
        }
    },
    {
        id: shortid.generate(),
        type: SIDEBAR_ITEM,
        component: {
            type: "---(   )---",
            content: "---(   )---"
        }
    }
];

export const SIDEBAR_ITEMS_OTHER = [{
    id: shortid.generate(),
    type: SIDEBAR_ITEM,
    component: {
        type: "+",
        content: ROW
    }
}];
